// src/SecondStep.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import Stepper from '../components/Stepper';

function SecondStep({ formData, onSave }) {
  const [additionalData, setAdditionalData] = useState({
    additionalField1: '',
    additionalField2: '',
    selectedRadio: '', // For radio buttons
    selectedDays: [], // For checkboxes
  });

  const navigate = useNavigate();

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setAdditionalData({ ...additionalData, [name]: value });
  };

  const handleRadioChange = (e) => {
    const { value } = e.target;
    setAdditionalData({ ...additionalData, selectedRadio: value });
  };

  const handleCheckboxChange = (e) => {
    const { value } = e.target;
    setAdditionalData((prev) => {
      const selectedDays = prev.selectedDays.includes(value)
        ? prev.selectedDays.filter((day) => day !== value)
        : [...prev.selectedDays, value];
      return { ...prev, selectedDays };
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const completeData = { ...formData, ...additionalData }; // Merge form data
    console.log(completeData); // Log complete data
    onSave(completeData); // Call save function
    // Navigate to next step or success page
  };

  return (
    <div className="container mt-5">
      <Stepper currentStep={2} />
      <h2 className="mb-4">2. Requested Services</h2>
      <form onSubmit={handleSubmit}>
        
        <h4 className="mb-3">Choose the Meal Plan you would like to receive</h4>
        <div className="mb-3">
          <div className="form-check">
            <input
              type="radio"
              name="selectedRadio"
              value="Full 21meals"
              className="form-check-input"
              onChange={handleRadioChange}
              checked={additionalData.selectedRadio === 'Option 1'}
            />
            <label className="form-check-label">Option 1</label>
          </div>
          <div className="form-check">
            <input
              type="radio"
              name="selectedRadio"
              value="Lunch and Dinner"
              className="form-check-input"
              onChange={handleRadioChange}
              checked={additionalData.selectedRadio === 'Option 2'}
            />
            <label className="form-check-label">Option 2</label>
          </div>
          <div className="form-check">
            <input
              type="radio"
              name="selectedRadio"
              value="Option 3"
              className="form-check-input"
              onChange={handleRadioChange}
              checked={additionalData.selectedRadio === 'Option 3'}
            />
            <label className="form-check-label">Option 3</label>
          </div>
        </div>

       
        <h4 className="mb-3">Days Requested</h4>
        <div className="mb-3">
          {['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'].map((day) => (
            <div className="form-check" key={day}>
              <input
                type="checkbox"
                className="form-check-input"
                value={day}
                onChange={handleCheckboxChange}
                checked={additionalData.selectedDays.includes(day)}
              />
              <label className="form-check-label">{day}</label>
            </div>
          ))}
        </div>

        {/* Navigation Buttons */}
        <div className="d-flex justify-content-between">
          <button
            type="button"
            className="btn backbtn"
            onClick={() => navigate(-1)} // Go back to the previous step
          >
            Back
          </button>
          <button
            type="submit"
            className="btn NextStepBtn"
          >
            Next Step
          </button>
        </div>
      </form>
    </div>
  );
}

export default SecondStep;
